import {} from './ProductListElements'

const ProductList = () => {
    const [products, setProducts] = useState([]);

    axios.get(`${process.env.REACT_APP_API_URL}/getAllProfesionalUsers`)
        .then((response) => {
            setProfesionals(response.data)
        })
        .catch((error) => {
            console.error(error);
        });

    return (
        <ProductListContainer>
            <ProductListWrapper>
            {professionals.map((item) => {
                    return (
                        <ProfessionalInfo> 
                            <ImgProfessional src={item.imgProfile} alt='imageProfesional'/>
                            <InfoWrap>
                                <Info id='fullName'>{item.firstName} {item.lastName}</Info>
                                <Info>{item.profession} - {item.location}</Info>    
                                <Info id='categories'>{item.categories.join(', ')}</Info>
                            </InfoWrap>
                            <BtnWrapper>
                                <BtnLink onClick={openModal ? () => openModal({name: item.firstName, lastName: item.lastName}) : routeChange} >+ AÃ±adir Citas</BtnLink>
                            </BtnWrapper>
                        </ProfessionalInfo>
                    );
                })}
                <ProductInfo> 
                    <ImgProduct src={item.imgProfile} alt='imageProfesional'/>
                    <InfoWrap>
                        <Info id='fullName'>{item.firstName} {item.lastName}</Info>
                        <Info>{item.profession} - {item.location}</Info>    
                        <Info id='categories'>{item.categories.join(', ')}</Info>
                    </InfoWrap>
                </ProductInfo>
            </ProductListWrapper>
        </ProductListContainer>
    )
}

export default ProductList
